// src/components/EditorManagement.js
import React from 'react';

const EditorManagement = ({ onAddEditor, onRemoveEditor, onViewEditors, onBack }) => (
  <div>
    <h2>Manage Editors</h2>
    <button onClick={onAddEditor}>Add Editor</button>
    <button onClick={onRemoveEditor}>Remove Editor</button>
    <button onClick={onViewEditors}>View Editors</button>
    <button onClick={onBack}>Back to Admin Options</button>
  </div>
);

export default EditorManagement;
